// src/components/Connections.js
import React from 'react';
// Create and use a context for connections

const Connections = () => {
  const { connections } = useConnectionsContext(); // Retrieve connections from context

  return (
    <div>
      <h1>Connections</h1>
      <ul>
        {connections.map((connection) => (
          <li key={connection.id}>{connection.name}</li>
        ))}
      </ul>
    </div>
  );
};

export default Connections;
